Short agreement with 7 more detailed protocols attached dealing with formation and recognition of political parties; elections; military; guarantees; ceasefire; donors conference. Aimed at reintegration of RENAMO as political party.  The Agreement also incoporates the following documents (listed and coded separately on database)They also accept as integral parts of the Ge~eral Peace Agreement for Mozambique the following documents: 
(a) The Joint Communique of 10 July 1990; 
(b) The Agreement of 1 December 1990; 
(c) The Declaration of the Government of the Republic of Mozambique and RENAMO on guiding principles for hurnanitarian assistance, signed in Rome on 16 July 1992; 
(d) The Joint Declaration signed in Rome on 7 August 1992.

